import React, { useState, useEffect } from 'react'
import Audio from 'react-audio'

class BackgroundEffect extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return <Audio source={this.props.config.url}/>
  }
}

export default BackgroundEffect;
